import React from "react";
const img1 ="assests/images/registernow.gif";

function Register() {
    return (
        <>
            <section id='main-section'>
                <div className='content-1'>
                    <h1>book your appoinment with us </h1>
                    <hr/>
                    <img classnamesrc={img1} alt='bookimg'/>
                </div>
                <div className='content-2'></div>
            </section>
        </>
    )
}
export default Register;
